<template>
  <div>
    <div
      v-for="NotesElement in this.TestNotes"
      :key="NotesElement.name"
    >
      <p class="h2 mx-auto"> {{NotesElement.name}} </p>
      <b-card-group deck class="flex-wrap justify-content-around">
        <b-card
          v-for="Note in NotesElement.notes"
          :key="Note.id"
          :header="Note.name"
          :img-src="Note.images"
          class="FlexCard mb-4"
        >
          <b-card-text>
            {{Note.text}}
          </b-card-text>
        </b-card>
      </b-card-group>
    </div>
  </div>
</template>

<script>


export default {
  name: 'Home',
  data(){
    return {
      TestNotes: [
        {
          name: "Pinned Notes",
          notes: []
        },
        {
          name: "All Notes",
          notes: []
        }
      ]
    }
  },
  created() {
    for (let i=1; i<11; i++){
      this.TestNotes[0].notes.push({
        name: "PinnedNote"+i,
        text: "TextOfPinnedNote"+i,
        id: i,
        images:
          `data:image/jpeg;base64,`
      });
      this.TestNotes[1].notes.push({
        name: "Note"+i,
        text: "TextOfNote"+i,
        id: i,
        images:
          `data:image/jpeg;base64,`
      });
    }
  }
}
</script>

